css:
@-moz-document domain("archive.foolz.us") {
.theme_default a, .theme_default a:visited {
    color: #A00148;
}

.theme_default .container-fluid {
    background: none repeat scroll 0 0 #FFEFF6;
}

.theme_default #footer {
    color: #F5F5F5
}

.theme_default {
    background: none repeat scroll 0 0 #FFDAEA;
}

.theme_default .post.highlight {
    background: none repeat scroll 0 0 #FF96C4;
}

.theme_default .thread_form_wrap {
    background: none repeat scroll 0 0 #FFDAEA;
}

.theme_default article.thread .post.author {
    color: #EE016A;
}

.theme_default article.thread > .thread_image_box {
    color: #FFC2DD;
}

.theme_default .post {
    background: none repeat scroll 0 0 #FFDAEA;
    border-bottom: 1px solid #FFB2D4;
}

.theme_default article.thread .post_author {
    color: #EE016A;
}

.theme_default .navbar .navbar-inner {
    background: none repeat scroll 0 0 #DD1B71;
}

.theme_default .post .post_file {
    color: #FF499A;
}

.theme_default #footer {
    background: none repeat scroll 0 0 #DD1B71;
}

.theme_default article.thread .backlink_list {
    color: #FF499A;
}
.theme_default .paginate {
    background: none repeat scroll 0 0 #FFD8E9;
}
.theme_default #reply_ajax_notices.success {
    background: none repeat scroll 0 0 #FFE6F1;
    border: 1px solid #FF59A2;
}
}
